class UserForm extends React.Component{

    state = {first_name:'', last_name:''}
    render(){
        return(
            <div>
                <form>
                    <label>Client's First Name </label>
                    <input type='text'placeholder='Blank' value={this.state.first_name}/>
                    <label>Client's Last Name </label>
                    <input type='text'placeholder='Blank' value={this.state.last_name}/>
                </form>
            </div>
        )
    }
}
export default UserForm
